import Vue from 'vue'
import VeeValidate, { Field } from 'vee-validate'
Vue.use(VeeValidate)

VeeValidate.Validator.localize('zh_CN',{
    messages:{
        ...zh_CN.messages,
        is:(Field) => `${Field}`
    },
    attributes:{
        ph
    }
})
